import React from 'react';
import { postsData } from '../postsData.js';
import SinglePost from '../SinglePost/index.jsx';

export default function PostContainer({ postsData: { id, heading, description, likes_count, liked, comments } }) {
    return (
        <div>
            {
                postsData.map(el => <SinglePost key={el.id} {...el} />)
            }
        </div>
    );
}
